import logo from './img/LocalendarLogo.svg';
import React from 'react';
import './App.css';
import Home from './Home'

class LoginBox extends React.Component {
  render() {
    return (
      <p>Login stuff goes here!!!</p>
    );
  }
}


function App() {
  const [homeDisplay, setHomeDisplay] = React.useState('none')
  return (
    <div onClick={()=>{setHomeDisplay('block')}}>
      {/* <Home/> */}
      <div className='home' style={{display: homeDisplay === 'none' ? 'block' : 'none'}}>
        <div className='logo-div'>
          <img src={logo} alt='logo' className='logo'/>
        </div>
        <div className='login-border'>
          <div className='login-box'>
            <LoginBox/>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
